import React from 'react';
import {Link} from 'react-router-dom'
import Logo from '../images/logo.svg';
function Nav() {
  return (
    <header className='flex p-8 justify-between text-Gray items-center h-8 w-11/12'>
        <div className='logo flex'>
           <img src={Logo} alt="" />

            <nav>
            <ul className="flex justify-between items-center navlinks">
                <li to='/' className='p-2' >Features</li>
                <li to='/' className='p-2' >Pricing</li>
                <li to='/' className='p-2' >Resources</li>
            </ul>
        </nav>
        </div>
       
        <div className="flex auth">
            <button>Login</button>
            <button className='text-white rounded bg-Cyan'>Sign Up</button>
        </div>
    </header>
  );
}
;
export default Nav;
